Lo que más disfruto de mi trabajo como presentadora de eventos o maestra de ceremonia, es ser testigo de historias llenas de lecciones, aprender de cada uno de mis clientes y celebrar junto a ellos el éxito obtenido. 

Felicidades a la gran familia @phantomrealestate por esta nueva etapa! Pido a Dios que sigan creciendo como grupo y celebro junto a ustedes este momento tan importante, soñado y esperado. Simplemente merecen, hoy están recogiendo los frutos de una cosecha llena de esfuerzo, disciplina, entrega y AMOR por el trabajo que realizan. 

Mil gracias por creer en mi y por darme la oportunidad de trabajar junto a ustedes. 

