Este año ha sido un año de crecimiento y aprendizaje, lleno de momentos muy duros que nos han ido moldeando y así es la vida, ese sube y baja de emociones que te lleva a disfrutar cuando estas en la cima y te mantiene alerta mientras caes! Hoy celebro una vez más la vida, sí LA VIDA esa que valoras solo cuando te dan un diagnóstico aterrador, esa que amas cuando estas a punto de perderla, esa que vives sin valorar y apreciar, sin recordar que es un don el don más hermoso que Dios pudo darte! 

Hoy agradezco porque esa adulta de 21 años que ustedes ven ahí es un milagro y para mi siempre será mi niña, mi primogénita,  la muestra de que se puede querer a alguien más que a uno mismo 💖  la voz que por primera vez me llamó Mamá  hoy le agradezco a Dios y a ustedes por permitirme vivir y disfrutar junto a ella tantos momentos maravillosos y especialmente celebrar en grande su mayoría de edad. TE AM
